import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div >
      <pepi/>
      <div className="App">
      <p>kamasutra</p>

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <ul>
      <li>1</li>
      <li>2</li>
        </ul> 
        <p>
          Edit <code>src/App.js</code> and save to reload. sumatra
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      </div>
    </div>
  );
}
const pepi = () => {
  return(
    <div>
    <p>
      Stonks
      </p>  
    </div>
  )
}

export default App;
